import React, {Component} from 'react'
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
import { Text, View, StatusBar, StyleSheet } from 'react-native'
import {Button} from 'react-native-elements';


class Devices extends Component {
    render() {
        return(
            <SafeAreaView style={deviceStyles.body}>
                <View style={deviceStyles.topBarButtons}>
                    <Button titleStyle={{fontWeight: "600", fontSize:16,justifyContent:"center",alignContent:"center"}} buttonStyle={deviceStyles.greenButton} containerStyle={{flex: 0.48}} title="ENTER CODE"></Button>
                    <Button titleStyle={{fontWeight: "600", color: "#777777", fontSize:16,justifyContent:"center",alignContent:"center"}} buttonStyle={deviceStyles.grayButton} containerStyle={{flex: 0.48}} title="TAP TO ADD"></Button>
                </View>
                <StatusBar style="auto" backgroundColor="rgb(68, 199, 188)" barStyle="dark-content" />
            </SafeAreaView>
        )
    }

}

var deviceStyles = StyleSheet.create({
    body: {
        backgroundColor: "#fbfbfb",
        height: "100%",
    },
    topBarButtons: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        backgroundColor: 'white',
        padding: 20,
        width: "100%",
        borderTopColor: "black",
        borderTopWidth: 1,
    },
    greenButton: {
        "paddingTop": 2.5,
      "paddingRight": 2.5,
      "paddingBottom": 2.5,
      "paddingLeft": 2.5,
      "backgroundColor": "rgb(68, 199, 188)",
      "shadowOffset": {
        "width": 0,
        "height": 0
      },
      "shadowRadius": 30,
      "shadowColor": "rgba(150, 255, 246, 0.7)",
      "shadowOpacity": 1,
      "borderStyle": "solid",
      "color": "white",
      "fontFamily": "sfd",
      "fontSize": 13,
      "fontWeight": "400",
      borderRadius: 5,
      "height": 40

    },
    grayButton: {
        "paddingTop": 2.5,
        "paddingRight": 2.5,
        "paddingBottom": 2.5,
        "paddingLeft": 2.5,
        "backgroundColor": "#fbfbfb",
        "shadowOffset": {
          "width": 0,
          "height": 0
        },
        "shadowRadius": 30,
        "shadowColor": "rgba(255, 255, 255, 0.7)",
        "shadowOpacity": 1,
        "borderWidth": 1,
        "borderColor": "#777777",
        "borderStyle": "solid",
        "color": "black",
        "fontFamily": "sfd",
        "fontSize": 13,
        "fontWeight": "400",
        borderRadius: 5,
        "height": 40
    }
});


export default Devices;
